import React from 'react';
import axios from 'axios';
class App extends React.Component {

	state = {
		details : [],
	}

	componentDidMount() {

		let data ;

		axios.get('http://127.0.0.1:8000/choosequiztype/')
		.then(res => {
			data = res.data;
			this.setState({
				details : data	
			});
			console.log('data:',data)
		})
		.catch(err => {})
	}

	render() {
		const details=this.state.details;
		return (
			<div>
		  		{details.map(el => {
					<div className='App'>
					
					</div>
				})}
			</div>

				  
		);
	}
}

export default App;
